    <div>
        <Paper className={classes.root}>
            <Typography variant="h3" component="h3">
                chat app
            </Typography>
            <Typography variant="h5" component="h5">
                Topic Place Holder
            </Typography>
            <div className = {classes.flex}>
                <div className = {classes.topicwindow}>
                    <List>

                    </List>
                </div>
                <div className = {classes.chatwindow}>

                </div>
            </div>
            <div className = {classes.flex}>

            </div>
        </Paper>
    </div>
  );
}
